import React, {useState, useEffect} from 'react'
import {DragDropContext, Droppable, Draggable} from 'react-beautiful-dnd';
interface Card{
    name: string;
}

const DeckBuilderPage = () => {
    const [CardsData, setCardsData] = useState<Card[]>([]);

    useEffect(() => {
        fetch('http://localhost:8000/DeckBuilder/GetAllCards')
          .then(res => res.json())
          .then((CardsData: Card[]) => {
            setCardsData(CardsData);
          })
          .catch(console.error);
        
          console.log(CardsData);
      }, []);
      
    

    return (
        <div>
            DeckBuilderPage <br/>

            <p>All Cards:</p>
            {/* <DragDropContext>
                <Droppable droppableId="name">
                {(provided) =>(
                <ul {...provided.droppableProps} ref={provided.innerRef}>
                    {CardsData.map(item => (
                        <Draggable key={item.name} draggableId={item.name}>
                            {(provided) =>(
                                <li {...provided.draggableProps} {...provided.dragHandleProps} ref={provided.innerRef}>
                                    <div>{item.name}</div>
                                </li>
                            )}
                        </Draggable>
                    ))}
                </ul>
                )}
                </Droppable>
            </DragDropContext> */}
            <DragDropContext onDragEnd={() => {}}>
                <Droppable droppableId="CardsData">
                    
                    {(provided) => (
                        <div className="AllCards" ref={provided.innerRef} {...provided.droppableProps}>
                        <ul ref={provided.innerRef} {...provided.droppableProps}>
                            {CardsData.map((item, index) => ( 
                            <Draggable draggableId={item.name} key={item.name} index={index}>
                            {(provided) => (
                                <li {...provided.draggableProps} {...provided.dragHandleProps} ref={provided.innerRef}>
                                    <div>{item.name}</div>
                                </li>
                            )}
                            </Draggable>
                            ))}
                        </ul>
                        </div>
                    )}
                    
                </Droppable>
                <Droppable droppableId="CardsData">
                    
                    {(provided) => (
                        <div className="CardsInDeck" ref={provided.innerRef} {...provided.droppableProps}>
                        <ul >
                            {CardsData.map((item, index) => (    
                            <Draggable draggableId={item.name} key={item.name} index={index}>
                            {(provided) => (
                                <li {...provided.draggableProps} {...provided.dragHandleProps} ref={provided.innerRef}>
                                    <div>{item.name}</div>
                                </li>
                            )}
                            </Draggable>
                            ))}
                        </ul>
                        </div>
                    )}
                    
                </Droppable>
            </DragDropContext>
        </div>
    )
}

export default DeckBuilderPage
